subSubSection.paragraph:
Description.
Body (
Figs. 5–6
) elongate and slender. Colour brown, yellow brown or grey brown—the colour of dry grass. Frontal shield with strong subanntenal ridge. Ocelli of male not well developed, of female poorly developed. Antennae of male about two thirds the length of prothorax, of female about one half to two thirds the length of prothorax. Prothorax rather elongate, metazone of pronotum with distinct dorsolateral carinae which become indistinct anteriorly and posteriorly. Foreleg with coxa distinctly shorter than metazone, femur with claw groove situated slightly distal of midpoint. Male volant but slightly brachypterous, wings reaching to caudal margin of fourth abdominal tergite; tegmen with costal area opaque cream coloured with thin blackish line on posterior margin; discoidal area semi opaque, sometimes flecked with darker spots; anal lobe slightly infumate; hindwing with costal and discoidal areas semi opaque, mostly reddish brown; anal area usually completely infumate, darker proximally, with contrasting transparent areas at cross veins creating speckled appearance. Female strongly brachypterous, wings reaching almost to caudal margin of second abdominal tergite; tegmen opaque, costal area similar in colour to male or similar in colour to discoidal area, discoidal area sometimes flecked with darker spots, anal lobe infumate; hindwing opaque, costal and discoidal areas reddish brown in proximal two thirds, anal area dark brownish black with slight bluish sheen, contrasting transparent areas at cross veins sparse and limited to anterior third or absent. Abdomen elongate and slender, supra-anal plate triangular, cerci reaching beyond tip of abdomen in male, to about tip of abdomen in female. Male genitalia (
Figs. 25–26
) with dpr short, truncate, narrowing before tip, with slightly to well developed posterior projection and sometimes anterior projection; pa compact with small blunt projections anteriorly and posteriorly; medial lobe of vph prominent and curved dorsally, anterior portion of vph broad; apr rather elongate and narrowed distally but with blunt tip. Female ventral ovipositor valves with hooks.
